import React from 'react';
import PropTypes from 'prop-types';
import Link from 'next/link';

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>
        <Link href="/">
          <a>메인 페이지</a>
        </Link>
        <Link href="/profile">
          <a>프로필 페이지</a>
        </Link>
        <Link href="/signup">
          <a>회원가입 페이지</a>
        </Link>
      </div>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isReactive,
};

export default AppLayout;
